// draw a gopher
func drawGopherAtLC(l, c int, done chan bool, gopherTicker time.Ticker) {
	fs := []int{0, 22, 44, 66, 88, 110, 132, 154, 176, 198, 220, 242, 264, 286, 308, 330, 352, 374, 396, 418, 440, 462, 484, 506}

	x := 0
	isForward := true

	for {
		select {
		case <-done:
			return

		case <-gopherTicker.C:
			if isForward {
				if x+1 < 24 {
					x = x + 1
				} else {
					isForward = false
					x = 22
				}
				for y := 0; y < 22; y++ {
					cursorLoc := "\033[" + strconv.Itoa(l+y) + ";" + strconv.Itoa(c) + "f"
					fmt.Print(cursorLoc + dancingGopher[fs[x]+y])
				}
			} else {
				if x-1 > 0 {
					x = x - 1
				} else {
					isForward = true
					x = 2
				}
				for y := 0; y < 22; y++ {
					cursorLoc := "\033[" + strconv.Itoa(l+y) + ";" + strconv.Itoa(c) + "f"
					fmt.Print(cursorLoc + dancingGopher[fs[x]+y])
				}
			}
		}
	}
}


func main() {
	gopherTicker := *time.NewTicker(25 * time.Millisecond)
	done := make(chan bool)

	go drawGopherAtLC(1,1,done,gopherTicker)
	go drawGopherAtLC(2,38,done,gopherTicker)
	go drawGopherAtLC(3,75,done,gopherTicker)

	time.Sleep(50 * time.Second)
	gopherTicker.Stop()
	done <- true
	fmt.Print("exiting")
}
